import {
    ExploreIcon,
    HomeIcon,
    MessageIcon,
    MoreIcon,
    NotificationIcon,
    ProfileIcon
} from '../Icons/Icon'
import logo from '../Images/batukar.png'
import SideLinks from "../Components/SideLinks";

// ? icon array list
const sideLinks = [
    {
        name: 'Home',
        icon: HomeIcon,
    },
    {
        name: 'Explore',
        icon: ExploreIcon,
    },
    {
        name: 'Notification',
        icon: NotificationIcon,
    },
    {
        name: 'Message',
        icon: MessageIcon,
    },
    {
        name: 'Profile',
        icon: ProfileIcon,
    },
    {
        name: 'More',
        icon: MoreIcon,
    }
]

const Sidebar = () => {
    return (
        <div className='flex flex-col justify-between w-72 px-2 pt-2'>
            <div>
                <div className='mt-1 mb-4 flex items-center justify-center w-16 h-16 rounded-full
                    hover:bg-dark-content transition cursor-pointer'>
                    <img src={logo} alt="batukar" className='w-12'/>
                </div>
                <nav className='mb-4'>
                    <ul>{sideLinks.map(item => (
                        <SideLinks/>
                    ))}</ul>
                </nav>
                <button></button>
            </div>
            <span>asdasdas</span>
        </div>
    );
};

export default Sidebar;
